import { useEffect, useState } from 'react'
import * as api from './frontend/api'

function App() {
    const [greeting, setGreeting] = useState('')

    useEffect(() => {
      const fetchGreeting = async () => {
          const greeting = await api.hello()
          setGreeting(greeting)
      };
      fetchGreeting()
  }, [])

    return (
    <div>
        <div>
        <button>Database</button>
        <button>Api</button>
        </div>
        <div>
          <input></input>
          <button></button>
        </div>
        <div>InfoCard</div>
        </div>
    )
}

export default App
